INSERT INTO `menu_contents` VALUES (1,'¿PARA QUÉ ES?','<p>Esta caja de herramientas se compone de una serie de<br />\r\n<span style=\"color:#2ecc71\">habilidades socioemocionales</span> que sirven para comprender<br />\r\nlas experiencias emocionales, relacionarse de manera<br />\r\nconstructiva con la diferencia, construir relaciones positivas<br />\r\ny transformar los estereotipos y prejuicios hacia las dem&aacute;s<br />\r\npersonas.<br />\r\nLas <span style=\"color:#2ecc71\">herramientas</span> que proponemos pueden impulsarla a<br />\r\ncambiar las respuestas habituales y autom&aacute;ticas, por<br />\r\nrespuestas que permiten tomar decisiones conscientes<br />\r\ny alcanzar objetivos alineados con su bienestar.</p>\r\n','/images_banner/2021-08-0317:22:32+0000_unnamed.jpg','2021-08-02 19:33:53.312079','2021-08-03 17:22:32.146278'),(2,'¿A QUIÉN VA DIRIGIDA?','<p>Las <strong>herramientas</strong> est&aacute;n dirigidas a quienes busquen<br />\r\nnuevos recursos y estrategias para el beneficio propio y<br />\r\nde las dem&aacute;s personas. Se trata de pr&aacute;cticas concretas<br />\r\ny l&uacute;dicas para utilizar en el d&iacute;a a d&iacute;a y que surgen de la<br />\r\nexperiencia basada en evidencia de la Fundaci&oacute;n en el<br />\r\npoder de los lenguajes creativos. Brindamos elementos<br />\r\n<strong>conceptuales y experienciales</strong> para la transformaci&oacute;n de<br />\r\nlas violencias en Colombia y Am&eacute;rica Latina.<br />\r\n<span style=\"color:#2ecc71\"><span style=\"font-size:20px\">&iexcl;Dese la oportunidad de vivirlo,<br />\r\npruebe y d&eacute;jese sorprender!</span></span></p>\r\n','/images_banner/2021-08-0317:22:47+0000_unnamed(1).jpg','2021-08-02 19:33:53.322971','2021-08-03 17:22:47.515137'),(3,'MODULOS',NULL,NULL,'2021-08-02 19:33:53.332754','2021-08-02 19:33:53.332754'),(4,'PRINCIPIOS','<p>Observe <span style=\"color:#2ecc71\">c&oacute;mo se prepara y dispone</span> usted al utilizar las<br />\r\nherramientas; recuerde que puede sacar un mayor provecho<br />\r\nsi usted reconoce que <span style=\"color:#2ecc71\">siempre es posible el cambio</span> en<br />\r\nusted y en otr@s (neuroplasticidad: la regeneraci&oacute;n del<br />\r\ncuerpo es un hecho qu&iacute;mico, org&aacute;nico)</p>\r\n\r\n<p><br />\r\nIndependientemente de si va utilizar estos ejercicios para<br />\r\nusted mismo o para facilitar un espacio con otras personas,<br />\r\nno deje pasar la oportunidad de <span style=\"color:#2ecc71\">vivirlos y experimentarlos.</span></p>\r\n\r\n<p><br />\r\nLINK LIBRO</p>\r\n','/images_banner/2021-08-0317:23:00+0000_unnamed(2).jpg','2021-08-02 19:33:53.341350','2021-08-03 17:23:00.923375'),(5,'KAS','<p>La <span style=\"color:#2ecc71\">Fundaci&oacute;n Konrad Adenauer &ndash;KAS-</span> es una fundaci&oacute;n pol&iacute;tica alemana que<br />\r\nlleva m&aacute;s de 50 a&ntilde;os en Colombia cooperando en el fortalecimiento de las<br />\r\ninstituciones democr&aacute;ticas, el fomento del respeto a los derechos humanos,<br />\r\nas&iacute; como en la promoci&oacute;n de la integraci&oacute;n regional, la formaci&oacute;n pol&iacute;tica y la<br />\r\nintegraci&oacute;n ciudadana activa.</p>\r\n\r\n<p><br />\r\nPara la <span style=\"color:#2ecc71\">KAS</span> el trabajo en las regiones es fundamental para aportar a la consolidaci&oacute;n<br />\r\nde la paz en Colombia. En este sentido, venimos impulsando iniciativas de paz<br />\r\ny construcci&oacute;n de memoria con el fin de dar a conocer la realidad del pa&iacute;s a<br />\r\ntrav&eacute;s de las voces de las comunidades.</p>\r\n\r\n<p><br />\r\nEn ese sentido, la promoci&oacute;n de iniciativas de construcci&oacute;n de paz ha estado<br />\r\nligada a nuestra labor desde nuestra llegada al pa&iacute;s. Nosotros creemos que<br />\r\nnuestra misi&oacute;n <span style=\"color:#2ecc71\">&ndash;el fortalecimiento de la democracia y del estado de derecho&ndash;</span> no<br />\r\nser&aacute;n posible del todo en la medida en que no se propicien escenarios de inclusi&oacute;n,<br />\r\nreparaci&oacute;n y digniﬁcaci&oacute;n de las v&iacute;ctimas y dem&aacute;s actores del conflicto.</p>\r\n\r\n<p><br />\r\nPues, en un panorama de posconflicto, una de las cosas m&aacute;s importantes es precisamente el objetivo del proyecto &ldquo;Arte para<br />\r\nReconstruir&rdquo;, transitar el camino de la reconciliaci&oacute;n. Con este proyecto, en el que cooperamos con la <span style=\"color:#2ecc71\">Fundaci&oacute;n Prolongar y<br />\r\nUSAID</span>, queremos sensibilizar y entregarle a la opini&oacute;n p&uacute;blica insumos que promuevan espacios de convivencia pac&iacute;ﬁca y perd&oacute;n.<br />\r\nUn proceso largo, sin duda, tambi&eacute;n complejo y doloroso, pero de gran importancia para toda la sociedad, m&aacute;s a&uacute;n en la coyuntura<br />\r\nhist&oacute;rica que atraviesa el pa&iacute;s.</p>\r\n\r\n<p><br />\r\nEn este contexto estamos convencidos de que herramientas como el arte pueden ser un veh&iacute;culo para que a trav&eacute;s del ejercicio<br />\r\nde hacer memoria se generen di&aacute;logos constructivos que preparen el terreno para intentar perdonar.</p>\r\n\r\n<p><br />\r\nEs de resaltar que con este ejercicio queremos digniﬁcar la memoria de v&iacute;ctimas civiles, de la <span style=\"color:#2ecc71\">Fuerza P&uacute;blica</span>, y personas en proceso<br />\r\nde reintegraci&oacute;n, todos sobrevivientes con discapacidades diversas, y quienes en muchas ocasiones se han sentido invisibilizadas.</p>\r\n\r\n<p><br />\r\nPor ello quisimos desarrollar siete historias visuales con testimonios de algunos de los participantes y que dan cuenta de su<br />\r\ntransformaci&oacute;n. Gracias a sus testimonios podemos advertir que para estos grupos la reparaci&oacute;n debe ser justa, sin diferencias<br />\r\ny sin discriminaci&oacute;n. Esto, porque m&aacute;s all&aacute; de las secuelas f&iacute;sicas quedan unas emocionales que son las m&aacute;s dif&iacute;ciles de superar<br />\r\ny por eso la necesidad de acompa&ntilde;ar ese proceso.</p>\r\n\r\n<p><br />\r\nEn ese sentido, desde la <span style=\"color:#2ecc71\">KAS</span>, queremos exaltar a todas las personas que participaron en esta iniciativa, valientes que nos prestaron<br />\r\nsus voces y le apostaron a la reconciliaci&oacute;n, y que con su historia de vida tambi&eacute;n han logrado sensibilizar y movilizar a la<br />\r\nciudadan&iacute;a.</p>\r\n\r\n<p><br />\r\nTambi&eacute;n agradecemos a todo el equipo de la <span style=\"color:#2ecc71\">Fundaci&oacute;n Prolongar, a Mar&iacute;a Elisa Pinto </span>su directora y por supuesto a <span style=\"color:#2ecc71\">USAID</span>.<br />\r\nGracias a su esfuerzo y compromiso fue posible realizar este proyecto.</p>\r\n\r\n<p><br />\r\nDe manera especial les invitamos a recorrer esta p&aacute;gina web, que contiene adem&aacute;s cinco recomendaciones para los formuladores<br />\r\nde pol&iacute;tica y otros actores del posacuerdo. Con este micrositio esperamos contribuir a aumentar la conciencia social alrededor<br />\r\nde esa tem&aacute;tica en el pa&iacute;s, as&iacute; como visibilizar y exaltar a las v&iacute;ctimas.</p>\r\n\r\n<p><br />\r\nSi bien, la decisi&oacute;n de perdonar es una decisi&oacute;n individual, estamos convencidos de que este proyecto ofrece una oportunidad<br />\r\npara que Colombia pueda trabajar a&uacute;n m&aacute;s en la reconstrucci&oacute;n de la verdad y la reconciliaci&oacute;n.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:right\"><span style=\"font-size:20px\"><span style=\"color:#2ecc71\">Hubert Gehring<br />\r\nRepresentante de la KAS en Colombia</span></span></p>\r\n','/images_banner/2021-08-0319:27:31+0000_LogoKASInterna.png','2021-08-02 19:33:53.351332','2021-08-03 19:27:31.657903');
/*!40000 ALTER TABLE `menu_contents` ENABLE KEYS */;
UNLOCK TABLES;

