INSERT INTO `sub_module_pages` VALUES (2,1,'Introducción a los Prejuicios','','https://youtu.be/Y39Ye-Joc8o',NULL,'','/img_modules/2021-08-0222:10:48+0000_1-IntroducciónalosPrejuicios.jpg','2021-08-02 22:10:48.194412','2021-08-04 14:58:35.919542'),(3,1,'Relatos y Testimonios ','En esta sección encontrará diferentes relatos y testimonios que dan cuenta de cómo los prejuicios afectan la vida de las personas. Por un lado, casos en donde una situación particular pone en evidencia un prejuicio que se tiene sobre alguien y por otro, algunas de las implicaciones que tiene ser receptor de un prejuicio.\r\n\r\n    • Sanvicentino (foto mural)\r\n    • El en-canto de Sol  ','',NULL,'','/img_modules/2021-08-0222:15:57+0000_2-RelatosyTestimonios(fotosSanVicente).jpg','2021-08-02 22:15:57.305480','2021-08-04 16:58:35.140990'),(4,1,'Ejercicio práctico: Garabateo','En esta  actividad usted podrá identificar los prejuicios que tiene, así como las emociones y comportamientos asociados a estos. Este puede ser un primer paso para explorar los prejuicios desde un lenguaje no verbal y encontrar oportunidades para su transformación.  \r\n\r\n    • Video de garabateo \r\n    • Audio ejercicio ','',NULL,'','/img_modules/2021-08-0222:28:43+0000_3-Ejerciciopráctico_Garabateo.jpg','2021-08-02 22:28:43.432458','2021-08-04 16:58:43.656736'),(5,1,'¿En qué se diferencian los estereotipos de los prejuicios?','¿En qué se diferencian los estereotipos de los prejuicios?','',NULL,'<p style=\"text-align:left\">Texto</p>\r\n','/img_modules/2021-08-0222:31:28+0000_4-¿Enquésediferencianlosestereotiposdelosprejuicios_.jpg','2021-08-02 22:31:28.215067','2021-08-02 22:31:28.215067'),(6,1,'Práctica de humanidad compartida','En este audio podrá encontrar una meditación de 5 minutos para cultivar sentimientos de compasión y humanidad compartida en el relacionamiento con otros. Este tipo de prácticas se basan en  la siguiente premisa: todas las personas queremos ser felices y estar libres del sufrimiento. \r\n\r\n    • Audio ejercicio ','https://soundcloud.com/lorena-valero-492844439/auto-observacion',NULL,'','/img_modules/2021-08-0222:33:56+0000_5-Prácticadehumanidadcompartida_.jpg','2021-08-02 22:33:56.695884','2021-08-04 16:58:25.085834'),(7,1,'Otros referentes para seguir explorando ','En esta sección encontrará otros referentes y contenidos ya existentes relacionados con los prejuicios, que le permitirán profundizar y seguir explorando en la identificación y concientización de todo aquello que tiene que ver con los prejuicios.\r\n\r\n    • Lista de referentes','',NULL,'','/img_modules/2021-08-0222:36:22+0000_6-Otrosreferentesparaseguirexplorando.jpg','2021-08-02 22:36:22.070700','2021-08-04 16:58:12.156033'),(8,2,'Introducción a la regulación de las emociones','Video animado','https://youtu.be/Y39Ye-Joc8o 	',NULL,'','/img_modules/2021-08-0315:36:46+0000_8-Identificacióndelasemociones.jpg','2021-08-03 15:36:46.479327','2021-08-04 14:59:08.221894'),(9,2,'Identificación de las emociones','Texto','',NULL,'','/img_modules/2021-08-0315:38:17+0000_8-Identificacióndelasemociones.jpg','2021-08-03 15:38:17.705694','2021-08-03 15:38:17.705694'),(10,2,'Cadena de pensamientos negativos','Cadena de pensamientos negativos','',NULL,'<ul>\r\n	<li>\r\n	<p style=\"text-align:left\">Texto</p>\r\n	</li>\r\n</ul>\r\n','/img_modules/2021-08-0315:39:01+0000_9-Cadenadepensamientosnegativos.jpg','2021-08-03 15:39:01.189053','2021-08-03 15:39:01.189053'),(11,2,'Ejercicio de auto-observación ','En este audio encontrará un ejercicio de 5 minutos para conectar con usted misma/o y observar cómo se encuentra a nivel físico, emocional y mental. Esto le permitirá conectar con el momento presente, mejorar su calidad de atención y de escucha interna.\r\n\r\n    • Audio','https://soundcloud.com/lorena-valero-492844439/humanidad-compartida-1',NULL,'','/img_modules/2021-08-0315:41:33+0000_10-Ejerciciodeauto-observación_.jpg','2021-08-03 15:41:33.888930','2021-08-04 16:59:00.422673'),(12,2,'Exploración con materiales de arte ','Este ejercicio es una invitación para explorar el bordado y/o el dibujo como herramientas para gestionar emociones difíciles como la ansiedad, la preocupación o el nerviosismo. Es una oportunidad para conectarse con el momento presente y descubrir posibles efectos de la repetición.\r\n\r\n    • Texto con descripción del ejercicio e imágenes','',NULL,'','/img_modules/2021-08-0315:43:39+0000_11-Exploraciónconmaterialesdearte.jpg','2021-08-03 15:43:39.053944','2021-08-04 16:59:12.107918'),(13,2,'Ejercicio corporal para soltar y liberar tensiones innecesarias ','En este video encontrará una secuencia de movimientos que le permitirán soltar y liberar emociones o pensamientos que estén siendo difíciles de acoger o que le estén generando algún malestar. Este tipo de ejercicios le permiten desbloquear las tensiones en su cuerpo y sentirse renovado.\r\n\r\n    • Video ','https://youtu.be/Y39Ye-Joc8o',NULL,'','/img_modules/2021-08-0315:45:56+0000_12-Ejerciciocorporalparasoltaryliberartensionesinnecesarias.jpg','2021-08-03 15:45:56.412986','2021-08-04 16:59:21.319214'),(14,2,'Ejercicio corporal para aquietar su mente y sus emociones ','En este video encontrará un ejercicio que le permitirá conectar con su interior, sus sensaciones corporales, su respiración y aquietar su mente y sus emociones a través del movimiento y el potencial de la visualización. \r\n\r\n    • Video ','https://youtu.be/Y39Ye-Joc8o',NULL,'','/img_modules/2021-08-0315:47:31+0000_13-Ejerciciocorporalparaaquietarsumenteysusemociones_.jpg','2021-08-03 15:47:31.441440','2021-08-04 16:59:31.617472'),(15,2,'Otros referentes para seguir explorando ','En esta sección encontrará otros referentes y contenidos ya existentes relacionados con las emociones, que le permitirán profundizar y seguir explorando en la identificación y regulación emocional.\r\n\r\n    • Lista de referentes','',NULL,'','/img_modules/2021-08-0315:49:15+0000_6-Otrosreferentesparaseguirexplorando.jpg','2021-08-03 15:49:15.301732','2021-08-04 16:59:42.618042'),(16,3,'Introducción','Introducción','',NULL,'<ul>\r\n	<li>\r\n	<p style=\"text-align:justify\"><strong>Texto</strong></p>\r\n	</li>\r\n</ul>\r\n','/img_modules/2021-08-0315:50:01+0000_14-Introducción.jpg','2021-08-03 15:50:01.312473','2021-08-03 15:50:01.312473'),(17,3,'Sincronización del movimiento con la respiración','Este ejercicio tiene como fin regular su organismo, aquietar internamente sus emociones y su mente. Asimismo, conectar con la vitalidad, la fuerza y el gozo de moverse fluidamente.\r\n\r\n    • Video','https://youtu.be/Y39Ye-Joc8o',NULL,'','/img_modules/2021-08-0315:50:25+0000_15-Sincronizacióndelmovimientoconlarespiración.jpg','2021-08-03 15:50:25.796137','2021-08-04 17:00:08.652357'),(18,3,'Ejercicio corporal para soltar y liberar tensiones innecesarias','En este video encontrará una secuencia de movimientos que le permitirán soltar y liberar emociones o pensamientos que estén siendo difíciles de acoger o que le estén generando algún malestar. Este tipo de ejercicios le permiten desbloquear las tensiones en su cuerpo y sentirse renovado.\r\n\r\n    • Video \r\n','https://youtu.be/Y39Ye-Joc8o',NULL,'','/img_modules/2021-08-0315:50:57+0000_12-Ejerciciocorporalparasoltaryliberartensionesinnecesarias.jpg','2021-08-03 15:50:57.915116','2021-08-04 17:00:16.496360'),(19,3,'Ejercicio corporal para aquietar su mente y sus emociones','En este video encontrará un ejercicio que le permitirá conectar con su interior, sus sensaciones corporales, su respiración y aquietar su mente y sus emociones a través del movimiento y el potencial de la visualización. \r\n\r\n    • Video ','https://youtu.be/Y39Ye-Joc8o',NULL,'<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n','/img_modules/2021-08-0315:51:23+0000_13-Ejerciciocorporalparaaquietarsumenteysusemociones_.jpg','2021-08-03 15:51:23.406762','2021-08-04 17:00:24.510280');
